1.0.0.description:
The development of this magento extension was sponsored by www.leanux.ch and it allows to export orders as XML-File. &#xD;
This XML-Files can be imported to the leanux.ch Enterprise Version of SQL-Ledger. During the import, SQL-Ledger will add the customers, articles, services and the orders. &#xD;
More information can be found here under http://sql-ledger.leanux.ch/index.php?magento-onlineshop. &#xD;

